import {addObj} from './Class';

export const songOperations = {
    songs : [],
    fillSongs(songs){
        for(let song in songs){
            this.songs.push(new addObj(song.artworkUrl100,song.trackName, song.trackViewUrl, song.previewUrl, song.artistViewUrl));
        }
        return this.songs;
    }
}
